import React, { Component } from "react";
import './rateandreview.css';

class RateAndReview extends Component {
    constructor(props) {
        super(props);
        this.state = {
            rating:"",
            review:"",
            username:"",
        };
    }

    render(){
        return(
            <>
                <div>
                    Rating your Agent
                    <label>Rating: </label><input type="text"/>
                    <label>Review: </label><input type="textbox"/>
                </div>
            </>
        )
    }


}

export default RateAndReview;
